import categories from'./components/category-item/category-item.styles';
const App = () =>{

    const categories =[
      { id:1,
        title:'Why Puppy Culture?',
        subtitle :'LEARN MORE'
      },
      { id:2,
        title:'Shop Our Products!?',
        subtitle :'SHOP'
      },
      { id:3,
        title:'What Should I Buy?',
        subtitle :'LEARN MORE'
      },
      { id:4,
        title:'Madcap University',
        subtitle :'LEARN MORE'
      },
    ];
  return (
  <div className="categories-container">
    {categories.map(({title,subtitle}) => (
        <div className='category-container'>
        <div className="background-image"/>
        <div className='category-body-container'>
          <h1>{title}</h1>
           <h2>{subtitle}</h2> 
        </div>
      </div>
    ))}
  </div>
  );
}

export default App;
